/**
 * @param {number[]} arr
 * @param {number} k
 * @return {number}
 */
var findLeastNumOfUniqueInts = function (arr, k) {

    let map = {};

    arr.forEach(num => {
        if (map[num] != undefined)
            map[num]++;
        else
            map[num] = 1;
    });

    const ascArr = Object.entries(map).sort((a, b) => a[1] - b[1]);

    let count = 0;
    for (let i = 0; i < ascArr.length; i++) {
        k -= ascArr[i][1];
        if (k < 0)
            break;
        count++;
        if (k == 0)
            break;

    }

    return ascArr.length - count;
};

